import React from 'react';
import './Table.css';


const OpenFormButton = () => {

  const handleClick = () => { 
    alert("hi")
  };


  return (
    <button onClick={handleClick} className='Form_Button'>
        <ion-icon name="reader" />
    </button>
  );
};

export default OpenFormButton;
